[DaneJones] Victoria (One More Time / 04.29.2014)

Champagne and flowers? Is it their anniversary, or an important birthday perhaps?Actually, it's Wednesday afternoon in the middle of an ordinary week for Victoria and Martin. He's such a romantic, always surprising her with poems, treats and ways to make her feel special. As you can see, a few drops of champagne are also quite an invitation for making love, as Martin slowly drinks each vintage droplet from her warm supple skin down the length of her body until he is drinking from within!

